import React from "react";
import { Link } from "react-router-dom";


function ErrorPage() {
    return (
        <main className="err-conteiner">
            <div className="text-block">
                <h2>Error 404</h2>
                <p className="err-tect">
                    The page you are looking for does not exist. How you got
                    here is a mystery. But you can click the button below to go
                    back to the homepage.
                </p>
                <Link className="btn btn-outline-warring" to={"/"}>
                    Home
                </Link>
            </div>
            <div className="img-blok">
                <img src='../../picture/404-image.png' alt="error image" />
            </div>
        </main>
    );
}

export default ErrorPage;
